// SPDX-License-Identifier: GPL-3.0
/*
INHERITANCE.
Similar to object oriented programming.
We need to point which parameter from the parent constructor we want to use.
Override: Functions defined as "virtual" to point that this function will be redefined.
          The function defined as "override" redefines the corresponding "virtual" func.
          There may be functions without implementation as abstarct contract to point
          for models to child contracts with posible implementation of this funcs.
Interfaces: Allows us to define behavior that we want to have a contract.
            It implements in the same way as the contract inheritance.
            Their functions does not have implementation, just headers.
Super:      To access to parent functions directly.          
*/

pragma solidity >=0.7.0 <0.9.0;

import "./Interface.sol";
import "../Platzi Solidity Intro/Modifiers.sol";

contract SumImplementation is Sum {

    function sum(uint num1, uint num2) public override pure returns(uint){
        return num1 + num2;
    }


}

Platzi Solidity Intro/Modifiers.sol.content:
// SPDX-License-Identifier: GPL-3.0
/*
ETHER TRANFERS FROM A CONTRACT
Send: Sends an amount of Ether to an address and returns false if is not successful.
Transfer: Sends an amount of Ether to an address and stops the function if is 
          not successful.
Call: Sends an amount of Ether to an address and returns the operation result.

Send and transfer require payable type addresses.
Send and transfer have gas limit of 2300 gas.

Call allows call functions if the address is a contract.
*/

pragma solidity >=0.7.0 <0.9.0;

contract Modifiers {
    address private owner;
    string private ownerName;
    
    constructor(string memory name) {
        owner = msg.sender;
        ownerName = name;
    }
    
    function Sum(uint num1, uint num2) public view IsOwner() returns (uint) {
        return num1 + num2;
    }
    
    modifier IsOwner() {
        if (msg.sender != owner) revert();
        _;
    }
    
}

